import styled from "styled-components";


export const HeaderComponent = styled.header`
    display: flex;
    background-color: #999;
    width: 100%;
    justify-content: center;
    align-items: center;
    color: #fff;
    flex-direction: column;


    img{
        width: 200px;
        height: auto;
    }
`;
